import React, { useEffect, useState } from 'react';
import authService from '../../../services/authService';

const ManageUsers = () => {
  const [users, setUsers] = useState([]);

  useEffect(() => {
    const fetchUsers = async () => {
      const data = await authService.getAllUsers();
      setUsers(data);
    };
    fetchUsers();
  }, []);

  const handleEdit = (userId) => {
    // Implement edit logic or navigation
    alert(`Edit user ${userId}`);
  };

  const handleDelete = async (userId) => {
    await authService.deleteUser(userId);
    setUsers(prev => prev.filter(user => user._id !== userId));
  };

  return (
    <div className="p-6">
      <h2 className="text-2xl font-bold mb-4">Manage Users</h2>
      <table className="min-w-full bg-white">
        <thead>
          <tr>
            <th className="py-2">User ID</th>
            <th className="py-2">Name</th>
            <th className="py-2">Email</th>
            <th className="py-2">Role</th>
            <th className="py-2">Actions</th>
          </tr>
        </thead>
        <tbody>
          {users.map(user => (
            <tr key={user._id}>
              <td className="py-2">{user._id}</td>
              <td className="py-2">{user.name}</td>
              <td className="py-2">{user.email}</td>
              <td className="py-2">{user.role}</td>
              <td className="py-2">
                <button className="px-2 py-1 bg-blue-500 text-white rounded mr-2" onClick={() => handleEdit(user._id)}>Edit</button>
                <button className="px-2 py-1 bg-red-500 text-white rounded" onClick={() => handleDelete(user._id)}>Delete</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default ManageUsers;
